import React from 'react';
import spiderman from './spiderman.jpg';

export default class MovieList extends React.Component {
    render () {
        let movies = [
            { 
                movie: 'Spiderman Far From Home',
                image: spiderman,
            },
        ]

        return (
            <div>
                {movies.map(movie => (
                    <div key={movie.movie}>
                        <h3>{movie.movie}</h3>
                        <img src={movie.image} alt={movie.movie} width="300" height="600"  />
                    </div>
                ))}
            </div>
        );
    }
}
